  false,\n\t\"url\": null,\n\t\"notes\": \"The TIGER/Line shapefiles and related database
  files (.dbf) are an extract of selected geographic and cartographic information
  from the U.S. Census Bureau's Master Address File /n               Topologically
  Integrated Geographic Encoding and Referencing (MAF/TIGER) Database (MTDB). The
  MTDB represents a seamless national file with no overlaps or gaps between parts,
  however, each TIGER/Linen               shapefile is designed to stand alone as
  an independent data set, or they can be combined to cover the entire nation. nn
  \              State Legislative Districts (SLDs) are the areas from which members
  are elected to State legislatures. The SLDs embody the upper (senate) and lower
  (house) chambers of the state legislature. Nebraskan               has a unicameral
  legislature and the District of Columbia has a single council, both of which the
  Census Bureau treats as upper-chamber legislative areas for the purpose of data
  presentation; theren               are no data by SLDL for either Nebraska or the
  District of Columbia. A unique three-character census code, identified by State
  participants, is assigned to each SLD within a state. In Connecticut,n               Illinois,
  Louisiana, Maine, Maryland, Massachusetts, Michigan, Ohio, and Puerto Rico, the
  Redistricting Data Program (RDP) participant did not define the SLDs to cover all
  of the state or staten               equivalent area. In these areas with no SLDs
  defined, the code \"ZZZ\" has been assigned, which is treated as a single SLD for
  purposes of data presentation. nn               The boundaries of the 2014 State
  legislative districts were provided by state-level participants through the RDP
  and reflect the districts used to elect members in or prior to the November 2014n
  \              election.n            \",\n\t\"license_title\": null,\n\t\"extras\":
